actionConfiguration.body:
() => {
  if (appsmith.store.user_role_id == 100) {
    navigateTo('Admin Page');
  } else if (appsmith.store.user_role_id == 101) {
    navigateTo('Team Leader');
  } else if (appsmith.store.user_role_id == 102) {
    navigateTo('Content Creator');
  } else if (appsmith.store.user_role_id == 103) {
    navigateTo('CA Page');
  } else if (appsmith.store.user_role_id == 104) {
    navigateTo('QA Page');
  } else if (appsmith.store.user_role_id == 105) {
    navigateTo('Devops Page');
  } else {
    showAlert('Role Not Assigned', 'Error');
  }
}

